import FamilyForm from '../components/FamilyForm';

const HomePage = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to the Home Page!</p>
      <FamilyForm />
    </div>
  );
};

export default HomePage;
